Police say that last summer Talia was abducted by her mother, Melinda Davis, who does not have legal custody of Talia, resulting in a warrant for felony child stealing being issued for Davis. Investigators say Talia has a life-threatening medical condition and finding her was critical because it was unlikely that she was receiving necessary medical care.

As part of the partnership between the National Center for Missing & Exploited Children (NCMEC) and the A&E network show Live PD, Talia’s case was featured on Live PD’s weekly missing child segment, which aired on May 16, 2020. That’s when one Live PD viewer immediately recognized Talia and Melinda, and contacted the NCMEC call center with important information no one expected. To read the rest, check out the link in our bio.

